    [],nt"revision_timestamp": "2016-01-01T13:41:09.314572",nt"name": "environmental-assessment-cross-island-complex-maine",nt"isopen":
    false,nt"url": null,nt"notes": "The United States Fish and Wildlife Service
    proposes to acquire fee title rights to approximately 1,355 acres by donation and
    130 acres by purchase of coastal island property in Washington County, Maine. The
    purpose of this acquisition would be to preserve and protect the unique wildlife
    ecosystem for nesting razorbill, black guillemot, double crested cormorant, common
    eider, and osprey populations. This report discusses the ramifications of either
    decision: to move forward or not too move forward with this acquisition.",nt"license_title":
